import React from "react";
import styles from './ProjectBox.module.css';
import stock_img1 from "../images/wallpapersden.com_macos-12-monterey-stock-dark_3840x2160.jpg";

export default function ProjectBox(){
    return <a class={styles.main_container} href="#">

    <div class="sub_container">

        <div>
            <img src={stock_img1} alt=""/>
            <p class={styles.title}>Library &nbsp;Management &nbsp;System</p>
        </div>
        
        <div class={styles.project_details}>
            <p class={styles.student_name}>by &nbsp;Leslie &nbsp;D'silva</p>
            <div class="rating_container">
                <i class="fa-regular fa-star fa-xs">&nbsp;&nbsp;</i>
                <p class="project_rating">4.7</p>
            </div>
        </div>

    </div>

</a>;
}
